import {card, button, name} from './City.module.css'

function City(props) {
  if (props.city !== undefined) {
    return (
      <div className={card}>
        <button className={button}> X </button>  
        <span className={name}>Nombre</span>
      </div>
    )
  } else {return (
    <div style={{color: 'white', fontSize: '20pt', textAlign: 'left', margin: '20px'}}>
      Error 404: ciudad no encontrada
    </div>  
  )}
}

export default City;
